def rgb_to_cmyk(r,g,b):
    cmyk_scale = 100
    if (r == 0) and (g == 0) and (b == 0):
        # black
        return 0, 0, 0, cmyk_scale

    # rgb [0,255] -> cmy [0,1]
    c = 1 - r / 255.
    m = 1 - g / 255.
    y = 1 - b / 255.

    # extract out k [0,1]
    min_cmy = min(c, m, y)
    c = (c - min_cmy) / (1 - min_cmy)
    m = (m - min_cmy) / (1 - min_cmy)
    y = (y - min_cmy) / (1 - min_cmy)
    k = min_cmy

    # rescale to the range [0,cmyk_scale]
    return round(c*cmyk_scale,2), round(m*cmyk_scale,2), round(y*cmyk_scale,2), round(k*cmyk_scale,2)

def get_random_hext():
  random.shuffle(colour_json)
  random_hext = colour_json[0]['hext']
  random_name = colour_json[0]['text']
  random_hext = random_hext.replace('#','')
  return random_name,random_hext

def get_random_colour(error=True):
  random_name,random_hext = get_random_hext()
  url = "http://dummyimage.com/300x300/%s/%s.png"%(random_hext,random_hext)
  if error:
    colour_name = "That colour was not found, but here's a random colour: %s"%(random_name)
  else:
    colour_name = random_name
  return colour_name,random_hext,url

