def get_colour(text,length=1):
  result_arr = []
  for colour in colour_json:
    if text in colour['text']:# or colour['text'].lower().startswith(text[:3]) or colour['text'].lower().endswith(text[:-3]):
      match_text = colour['text']
      match_hext = colour['hext'].replace('#','')
      url = "http://dummyimage.com/10x10/%s/%s.png"%(match_hext,match_hext)
      result_arr.append([match_text,match_hext,url])

    if len(result_arr) < 3:
      if colour['text'].lower().startswith(text[:3]) or colour['text'].lower().endswith(text[-3:]):
        match_text = colour['text']
        match_hext = colour['hext'].replace('#','')
        url = "http://dummyimage.com/10x10/%s/%s.png"%(match_hext,match_hext)
        result_arr.append([match_text,match_hext,url])

    if len(result_arr) < 3:
      if colour['text'].lower().startswith(text[:2]) or colour['text'].lower().endswith(text[-2:]):
        match_text = colour['text']
        match_hext = colour['hext'].replace('#','')
        url = "http://dummyimage.com/10x10/%s/%s.png"%(match_hext,match_hext)
        result_arr.append([match_text,match_hext,url])

    random.shuffle(result_arr)
    #return colour_json
  return result_arr[:length]

  #return None


def hex_to_rgb(value):
    value = value.lstrip('#')
    lv = len(value)
    rgb = tuple(int(value[i:i+lv/3], 16) for i in range(0, lv, lv/3))
    #return rgb[0],rgb[1],rgb[2]
    return rgb

def rgb_to_hex(r,g,b):
    return '%02x%02x%02x'%(r, g, b)

def shade(r,g,b,shade_factor=0.2):
    newR = (r * (1 - shade_factor) ) or 0
    newG = (g * (1 - shade_factor) ) or 0
    newB = (b * (1 - shade_factor) ) or 0
    return (int(newR),int(newG),int(newB))

def tint(r,g,b,tint_factor=0.2):
    newR = (r + (255 - r) * tint_factor) #and 255
    newG = (g + (255 - g) * tint_factor) #and 255
    newB = (b + (255 - b) * tint_factor) #and 255
    return (int(newR),int(newG),int(newB))


